import React from "react";
import { useState, useEffect } from "react";
const Products = () => {
  const [locator, setLocator] = useState([]);

  return (
    // <div className=" h-screen flex justify-center items-center bg-yellow-300">
    //   <h1 className="text-9xt uppercase font-black">Products</h1>
    <>
      <div className="formula">
        {locator.map((formula) => {
          return (
            <div className="formula" key={formula.id}>
              <h4>Name: {formula.name}</h4>
              <h5>image: {formula.image}</h5>
              <h5>price: {formula.price}</h5>
            </div>
          );
        })}
      </div>
    </>
  );
};

export default Products;
